import React from "react";
import { Route } from "react-router-dom";
import Quotes from "./Components/Quotes/Quotes";
import NewsApp from "./Components/News/NewsApp";
import WeatherApp from "./Components/Weather/WeatherApp";
import Acne from "./Components/Acne/Acne";

import "./App.css";

function App() {
  var quotes = <Quotes></Quotes>;
  var acne = <Acne></Acne>;
  var news = <NewsApp></NewsApp>;
  var weather = <WeatherApp></WeatherApp>;
  return (
    <div>
      <header className="App-header">
        <nav>
          <ul>
            <li>
              <a href="/"> home</a>
            </li>
            <li>
              <a href="/acne"> acne</a>
            </li>
            <li>
              <a href="/weather"> weather</a>
            </li>
            <li>
              <a href="/inspiration"> inspiration</a>
            </li>
            <li>
              <a href="/news"> news</a>
            </li>
          </ul>
        </nav>
      </header>
      <Route path="/acne" render={() => acne} />
      <Route path="/weather" render={() => weather} />
      <Route path="/inspiration" render={() => quotes} />
      <Route path="/news" render={() => news} />
      {/* <section className="Quotes">
        <Quotes></Quotes>
      </section>
      <section className="News">
        <NewsApp></NewsApp>
      </section>
      <section className="Weather">
        <WeatherApp></WeatherApp>
      </section>
      <section className="Acne">
        <Acne></Acne>
      </section> */}
    </div>
  );
}

export default App;
